    def countCoumns(columns: Array[String]) = {
        val result: Map[Char, Int] = columns.flatMap(_.toCharArray).map((_, 1)).groupBy(_._1).mapValues(_.length)
        val sum = result.values.sum.toDouble
        println(result)
        println(result.mapValues(_ / sum))
    }

    def transfor(str: String) = {
        val result = str.toCharArray.map(x => {
            x.isDigit match {
                case true => x.toString.toInt
                case false => x.toInt-96
            }
        })
        result.sum
    }
